    false,nt"url": null,nt"notes": "NODC Accession 0100070 includes chemical,
    physical, time series and underway - surface data collected from MOORINGS in the
    North Pacific Ocean and South Pacific Ocean from 2007-02-18 to 2007-10-03. These
    data include CARBON DIOXIDE - AIR, CARBON DIOXIDE - PARTIAL PRESSURE (pCO2), CARBON
    DIOXIDE - PARTIAL PRESSURE - DIFFERENCE, OXYGEN - PERCENT SATURATION, SALINITY and
    SEA SURFACE TEMPERATURE. The instruments used to collect these data include Carbon
    dioxide (CO2) gas analyzer and Carbon dioxide (CO2) laminar flow bubble equilibrator
    (for buoy measurement).nnThese data were collected by Christopher Sabine of US DOC;
    NOAA; OFFICE OF OCEANIC AND ATMOSPHERIC RESEARCH; PACIFIC MARINE ENVIRONMENTAL LABORATORY
    as part of the Mooring JKEO_147E_38N data set. CDIAC assigned the following cruise
